'''Gold-trimmed studded leather armour''' is a set of [[Ranged armour]] that has identical bonuses as [[Studded leather armour]]. Pieces of the armour can be obtained as rewards from [[Clue scroll (easy)|easy]] [[Treasure Trails]]. The set consists of only body and chaps.

